window.bookSummaryJSON = "<p>With my fated mate at my side, we face the final showdown for survival.</p> <p>The attacks on wolf shifter packs continue to rage on. Humans will stop at nothing to see us wiped out. And those we once trusted continue to help them.</p> <p>Deception is our game now.</p> <p>We must use all our resources to rescue the captive packs. Before it's too late.</p> <p>The only thing stronger than the bond with my mate is my determination.</p> <p>Blood will be shed in this fight. But we're willing to risk it all to save our species. Survival of the supernatural world hangs in the balance.</p> <p>It's a battle I can only hope we won't lose.</p>"; 
